class DataContainer:
    colaFifo: PriorityQueue
    lock

    def __init__(self):
        self.colaFifo = PriorityQueue()
        self.lock = threading.Lock()

    def put(self, entrada):
        self.lock.acquire()
        self.colaFifo.put(entrada)
        self.lock.release()

    def get(self):
        return self.colaFifo.get()


